css:
@-moz-document url-prefix('https://dienynas.tamo.lt/Prisijungimas')  {
        body {
          background-color: #f0f0f0 !important;
        }
        .col_left {
          position: absolute;
          background-size: cover;
          width: 750px;
          height: 450px;
          min-height: 0;
          top: 50%;
          left: 40%;
          transform: translate(-50%, -50%);
          border-radius: 20px 0 0 20px;
        }
        .col_right {
          position: absolute;
          height: 450px;
          width: 350px;
          min-height: 0;
          top: 50%;
          left: 40%;
          transform: translate(-50%, -50%);
          background: transparent !important;
          margin-left: 550px;
        }
        #main_form {
          height: 450px;
          border-radius: 0 20px 20px 0;
        }
        .login_div {
          position: absolute;
          top: 22%;
          width: 300px !important;
        }
        div:nth-child(12) {
          margin-top: 20px;
        }
        div:nth-child(12), div:nth-child(14) {
          text-align: center !important;
        }
        #external_providers, div:nth-child(11), div:nth-child(15) {
          display: none;
        }
}
